import React from 'react';
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import { Menu, Container } from 'semantic-ui-react';
import Routes from './routes';

 class Navbar extends React.Component {
  state = {}

  handleItemClick = (e, { name }) => this.setState({ activeItem: name })

  render() {
    const { activeItem } = this.state

    return (
      <Router>
        <Menu inverted style={{ backgroundColor: '#37003C'}}>
          <Container>
              <Menu.Item header style={{ color: 'white' }}>PremInfo</Menu.Item>
              <Menu.Item
                  style={{ color: 'white' }}
                  name='Fixtures and Results'
                  active={activeItem === 'Fixtures and Results'}
                  onClick={this.handleItemClick}
              >
              <Link to='/'>Fixtures and Results</Link>
              </Menu.Item>
              <Menu.Item
                style={{ color: 'white' }}
                name='Table'
                active={activeItem === 'Table'}
                onClick={this.handleItemClick}
              />
          </Container>
          <Routes/>
        </Menu>
      </Router>
    )
  }
}

export default Navbar;
